  const [userEmail, setUserEmail] = useState('')

  return (
    <div className="hire-app">
      <LoginContext.Provider value={{userEmail, setUserEmail, candidateLoggedIn, setCandidateLoggedIn }}>
        <Login></Login>
      </LoginContext.Provider>

    </div>
  );
}

export default App;
